import React, { Component } from 'react';

class Experience extends Component {
  render() {
    return (
        <div className="container-fluid">
            <h1>
                Experience Page Content
            </h1>
            <p>
                Hand-In-Hand was started by Daniel Gomez, a retired firefighter. He teaches his classes to American Red Cross standards and uses the most up to date manikins which have instrumented directive feedback....
            </p>
        </div>
    );
  }
}

export default Experience;
